import React from 'react'
import ReactHowler from 'react-howler'
 
export const  Music=()=>{
  // This sound file may not work due to cross-origin setting
    return (
      <ReactHowler
        src='./assets/T1.mp3'
        playing={true}
      />
    )
  }
